import React, { useState } from "react";
import "./Register.css";

function Register() {
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [phone, setPhone] = useState("");
  const [password, setPassword] = useState("");
  const [confirmPassword, setConfirmPassword] = useState("");
  const [avatar, setAvatar] = useState(null);
  const [showPassword, setShowPassword] = useState(false);
  const [showConfirmPassword, setShowConfirmPassword] = useState(false);

  const handleAvatarChange = (e) => {
    const file = e.target.files[0];
    if (file) {
      setAvatar(URL.createObjectURL(file));
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (password !== confirmPassword) {
      alert("M·∫≠t kh·∫©u kh√¥ng kh·ªõp!");
      return;
    }
    alert("ƒêƒÉng k√Ω th√†nh c√¥ng!");
  };

  return (
    <div className="register-container">
      <h2 className="register-title">ƒêƒÉng k√Ω t√†i kho·∫£n</h2>
      <form className="register-form" onSubmit={handleSubmit}>
        
        {/* Avatar */}
        <div className="avatar-upload">
          <label htmlFor="avatarInput" className="avatar-label">
            {avatar ? (
              <img src={avatar} alt="avatar preview" className="avatar-preview" />
            ) : (
              <span className="avatar-placeholder">Ch·ªçn ·∫£nh</span>
            )}
          </label>
          <input
            type="file"
            id="avatarInput"
            accept="image/*"
            onChange={handleAvatarChange}
            hidden
          />
        </div>

        {/* H·ªç t√™n */}
        <div className="form-group">
          <label>H·ªç v√† t√™n</label>
          <input
            type="text"
            value={name}
            onChange={(e) => setName(e.target.value)}
            required
          />
        </div>

        {/* Email */}
        <div className="form-group">
          <label>Email</label>
          <input
            type="email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
          />
        </div>

        {/* S·ªë ƒëi·ªán tho·∫°i */}
        <div className="form-group">
          <label>S·ªë ƒëi·ªán tho·∫°i</label>
          <input
            type="tel"
            value={phone}
            onChange={(e) => setPhone(e.target.value)}
            required
          />
        </div>

        {/* M·∫≠t kh·∫©u */}
        <div className="form-group password-field">
          <label>M·∫≠t kh·∫©u</label>
          <input
            type={showPassword ? "text" : "password"}
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            required
          />
          <button
            type="button"
            className="toggle-password"
            onClick={() => setShowPassword(!showPassword)}
          >
            {showPassword ? "üôà" : "üëÅÔ∏è"}
          </button>
        </div>

        {/* X√°c nh·∫≠n m·∫≠t kh·∫©u */}
        <div className="form-group password-field">
          <label>X√°c nh·∫≠n m·∫≠t kh·∫©u</label>
          <input
            type={showConfirmPassword ? "text" : "password"}
            value={confirmPassword}
            onChange={(e) => setConfirmPassword(e.target.value)}
            required
          />
          <button
            type="button"
            className="toggle-password"
            onClick={() => setShowConfirmPassword(!showConfirmPassword)}
          >
            {showConfirmPassword ? "üôà" : "üëÅÔ∏è"}
          </button>
        </div>

        {/* N√∫t ƒëƒÉng k√Ω */}
        <button type="submit" className="register-btn">
          ƒêƒÉng k√Ω
        </button>
      </form>
    </div>
  );
}

export default Register;
